import React from "react";
//import { withRouter } from 'react-router-dom';
import { Nav, Navbar, Link, NavDropdown, Button, Form, FormControl, NavItem, Brand } from 'react-bootstrap'

import "../navigation/navigation.css";
import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css'

export class CommunicatorNavigation extends React.Component {
  render() {
    return (
      <Navbar className="navbar navbar-inverse menu-background sht-navbar">
        <Brand href="#home">Navbar</Brand>
        <Nav className="mr-auto">
          <NavItem href="#home">Home</NavItem>
          <NavItem href="#features">Features</NavItem>
          <NavItem href="#pricing">Pricing</NavItem>
        </Nav>
      </Navbar>
    )
  }
}
